import React from "react";
import {
  Card,
  CardHeader,
  CardContent,
  CardActions,
  Typography,
  List,
  ListItem,
  ListItemText,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/styles";
import { UnitTemplate } from "./UnitTemplate";

const cardStyle = makeStyles({});

function SingleUnitBlock() {
  return (
    <div>
      <Card>
          {SingleUnitBlock.map((val, key) => (
              <CardContent>
                  <List key={key}>
                      <ListItem>
                          <ListItemText>{val.title}</ListItemText>
                          <ListItemText>{val.grade}</ListItemText>
                      </ListItem>
                  </List>
              </CardContent>
          ))}

      </Card>
    </div>
  );
}

export default SingleUnitBlock;
